  console.log(id);
  return (
    <Col md={3} xs={6} style={{ padding: '5px' }}>
      <Card body>
        <tbody>
          <tr>{id}</tr>
        </tbody>
      </Card>
    </Col>
  );
}

export default OrderItems;
